                        document.addEventListener("DOMContentLoaded", function () {
                            const container = document.querySelector('#colored-map-{{ Str::slug($project_name, '_') }}');
                    
                            if (container) {
                                const polygons = container.querySelectorAll("polygon, rect");
                    
                                polygons.forEach(p => {
                                    p.addEventListener("click", function () {
                                        const region_id = p.getAttribute("id");
                                        if (region_id && regions_{{ Str::slug($project_name, '_') }}.has(region_id)) {
                                            let current = regions_{{ Str::slug($project_name, '_') }}.get(region_id).status;
                                            regions_{{ Str::slug($project_name, '_') }}.set(region_id, { status: (current + 1) % 2 });
                                            sync_animation_{{ Str::slug($project_name, '_') }}();
                                        }
                                    });
                                });
                            }
                        });
