                      <script>
                        var regions_{{ Str::slug($project_name, '_') }} = new Map();
                    
                        @foreach ($data['data']['items'] as $item)
                            regions_{{ Str::slug($project_name, '_') }}.set("unit-{{ $item['id'] }}", { status: {{ (int) $item['status'] }} });
                        @endforeach
                    
                        $(document).ready(function () {
                            sync_animation_{{ Str::slug($project_name, '_') }}();
                        });
                    
                        var stopBlinking_{{ Str::slug($project_name, '_') }} = false;
                    
                        function blink_{{ Str::slug($project_name, '_') }}(selector) {
                            if (stopBlinking_{{ Str::slug($project_name, '_') }}) return;
                            $(selector).fadeOut(800, () => $(selector).fadeIn(800, () => blink_{{ Str::slug($project_name, '_') }}(selector)));
                        }
                    
                        function stopBlinkingforPrint_{{ Str::slug($project_name, '_') }}() {
                            for (var region_id of regions_{{ Str::slug($project_name, '_') }}.keys()) {
                                $("#" + region_id).stop(false, true);
                                $("#" + region_id).stop();
                            }
                        }
                    
                        function sync_animation_{{ Str::slug($project_name, '_') }}() {
                            for (var region_id of regions_{{ Str::slug($project_name, '_') }}.keys()) {
                                $("#" + region_id).stop();
                                const status = regions_{{ Str::slug($project_name, '_') }}.get(region_id).status;
                    
                                if (status === 1) {
                                    $("#" + region_id).css({ fill: "rgba(217, 217, 217, 0.65)" });
                                } else if (status === 2) {
                                    $("#" + region_id).css({ fill: "rgba(201, 211, 229, 0.65)" });
                                } else if (status === 3) {
                                    $("#" + region_id).css({ fill: "rgba(247, 245, 152, 0.65)" });
                                } else if (status === 4) {
                                    $("#" + region_id).css({ fill: "rgba(241, 217, 126, 0.65)" });
                                } else if (status === 5) {
                                    $("#" + region_id).css({ fill: "rgba(93, 170, 222, 0.65)" });
                                } else if (status === 6) {
                                    $("#" + region_id).css({ fill: "rgba(239, 196, 161, 0.65)" });
                                } else if (status === 11) {
                                    $("#" + region_id).css({ fill: "rgba(0, 255, 0, 0.65)" });
                                } else if (status === 12) {
                                    $("#" + region_id).css({ fill: "rgba(255, 0, 0, 0.65)" });
                                }
                            }
                        }
                    
                        $(function () {
                            $("rect,polygon").on('click', function () {
                                const region_id = $(this).attr('id');
                                if (region_id !== 'svgId') {
                                    if (regions_{{ Str::slug($project_name, '_') }}.has(region_id)) {
                                        regions_{{ Str::slug($project_name, '_') }}.set(region_id, {
                                            status: (regions_{{ Str::slug($project_name, '_') }}.get(region_id).status + 1) % 2
                                        });
                                    } else {
                                        regions_{{ Str::slug($project_name, '_') }}.set(region_id, { status: 1 });
                                    }
                                }
                                sync_animation_{{ Str::slug($project_name, '_') }}();
                            });
                    
                            $("#start").click(function () {
                                var region_ids = $("#myInput").val().split(",");
                                stopBlinking_{{ Str::slug($project_name, '_') }} = false;
                                for (var i = 0; i < region_ids.length; i++) {
                                    $("#loot" + region_ids[i]).css({ fill: "rgba(10, 200, 10, 0.65)" });
                                    blink_{{ Str::slug($project_name, '_') }}("#loot" + region_ids[i]);
                                }
                                panToAPoint(region_ids[0]);
                            });
                    
                            $("#end").click(function () {
                                var region_ids = $("#myInput").val().split(",");
                                for (var i = 0; i < region_ids.length; i++) {
                                    $("#loot" + region_ids[i]).stop(false, true);
                                    $("#loot" + region_ids[i]).stop();
                                    $("#loot" + region_ids[i]).css({ fill: "rgba(250, 10, 10, 0.65)" });
                                }
                                Reset();
                            });
                    
                            $("#reset").click(function () {
                                var region_ids = $("#myInput").val().split(",");
                                for (var i = 0; i < region_ids.length; i++) {
                                    $("#loot" + region_ids[i]).stop(false, true);
                                    $("#loot" + region_ids[i]).stop();
                                    $("#loot" + region_ids[i]).css({ fill: "rgba(250, 250, 250, 0.01)" });
                                }
                                Reset();
                            });
                        });
                    
                        function sleep_{{ Str::slug($project_name, '_') }}(time) {
                            return new Promise((resolve) => setTimeout(resolve, time));
                        }
                    </script>
                    
                    
               
                
               
